update log_summary
SET blank_lines = ${text.line.count:minus(${text.line.nonempty.count})}
where filename = '${filename}' and ff_uuid= '${files_uuid}'

update log_summary
SET blank_lines = ${text.line.count:minus(${text.line.nonempty.count})}
where filename = '${filename}' and ff_uuid= '${files_uuid}'

(select 
SUM(CASE when school_id IS NULL THEN 1 ELSE 0 END) AS count_null_schoolid
from flowfile)

